import React, { Component } from 'react';

function ShowUserCharacters(props){
    // console.log(props)
    const { characters } = props
    // console.log(characters)

    return(
        <div className="UserCharacters">
            {PopulateCharacters(characters)}
        </div>
    )
}
function PopulateCharacters(userCharacters){
    // console.log(userCharacters);

    userCharacters.forEach(character => {
        console.log(character)
        return(
            <div className={`${character.name}`}>
                <h1>{character.name}</h1>
                <h2>{character.level}</h2>
                {/* <p>{character.physique}</p> */}
                <p>{character.current_experience}</p>
            </div>
        )
    })
}
export default ShowUserCharacters;

